ng and Information System, and the Department of Communication Technology and Network. Faculty of Computer Science and Information Technology is the first faculty to introduce "Green IT".`,o.jsx("span",{className:"font-bold cursor-pointer",onClick:()=>t("https://www.upm.edu.my/?L=en"),children:" Read more..."})]}),o.jsxs("div",{children:[o.jsx("img",{src:bl,className:"h-28 object-contain mx-auto mt-3 basis-1/3",alt:"UPM Logo"}),o.jsx("p",{className:"text-mred italic text-sm mx-auto",children:"Faculty of Computer Science and Information Technology"})]})]})]})})})]}),o.jsx("div",{className:"px-5 sm:px-5 lg:px-10 py-5 sm:py-0 flex flex-col lg:flex-row gap-5 w-full max-w-[1440px] mx-auto",children:o.jsxs("div",{className:"flex-1",children:[o.jsxs("div",{className:"p-1 about-content",children:[o.jsx("h1",{className:"text-xl sm:text-2xl font-semibold text-purple-800",children:"About the Conference"}),o.jsx("hr",{className:"h-[2px] bg-purple-700"}),o.jsxs("div",{className:"flex flex-col lg:flex-row gap-5",children:[o.jsx("p",{className:"mt-2 basis-2/3",children:`The 8th International Conference on Recent Trends in Advanced Computing (ICRTAC'25), scheduled for November 14th and 15th, 2025, at the Vellore Institute of Technology (VIT) Chennai, India, is centered on the theme "Automating Sustainability: Bridging SDG Goals with Recent Trends in Advanced Computing." This event is dedicated to harnessing advanced computing technologies to tackle the United Nations' Sustainable Development Goals (SDGs), aiming for global progress in ending poverty and ensuring environmental protection by 2030. With a comprehensive agenda covering areas such as Blockchain, Cryptocurrency, 5G/6G Wireless, Drones, AI/ML, Quantum Computing, AR/VR, Digital Twin, Smart Cities, Fog/Edge Computing, Cyber security, automation, and Industry 4.0, the conference seeks to pioneer advanced algorithmic approaches surpassing classical techniques. It serves as an interdisciplinary platform for researchers, practitioners, and educators to deliberate on innovations in advanced computing, propose sustainable solutions to real-world challenges, explore novel automation methods, and integrate cutting-edge technologies with Robotic Process Automation to align SDG goals with recent trends in advanced computing, underscoring the imperative of automating sustainability for global development. In partnership, UPM, BIS, and UiPath converge to champion sustainable development through their expertise in agricultural sciences, standardization, quality certification, and AI-powered enterprise automation, with a shared commitment to driving impactful solutions and fostering innovation on a global scale.`}),o.jsx("img",{src:hx,className:"h-64 object-contain flex items-center justify-center mx-auto mt-3 basis-1/3",alt:"ICRTAC Logo"})]})]}),o.jsxs("div",{className:"p-1 mt-10 objectives-content",children:[o.jsx("h1",{className:"text-xl sm:text-2xl font-semibold text-purple-800",children:"Objectives"}),o.jsx("hr",{className:"h-[2px] bg-purple-700"}),o.jsxs("ul",{className:"list-disc list-inside mt-3",children:[o.jsx("li",{children:"Explore the potential applications of advanced techniques in computing to provide innovative solutions"}),o.jsx("li",{children:"Provide an interdisciplinary platform for researchers, practitioners, and educators to discuss contemporary innovations in advanced computing and suggest sustainable solutions to real world problems"}),o.jsx("li",{children:"Investigate novel methods in automation and intelligent techniques, integrating cutting-edge computing technologies with the use of Intelligent Process Automation"}),o.jsx("li",{children:"Bridge SDG goals and Indian Standards with recent trends in advanced computing, emphasizing the importance of automating sustainability for global development"})]})]}),o.jsxs("div",{className:"p-1 mt-10 tracks-content",children:[o.jsx("h1",{className:"text-xl sm:text-2xl font-semibold text-purple-800",children:"Tracks"}),o.jsx("p",{class https://www.uipath.com/"),children:" Read more..."})]}),o.jsx("img",{src:pd,className:"h-24 object-contain mx-auto mt-3 flex items-center justify-center basis-1/3",alt:"UI Path Logo"})]})]})})]})]}),o.jsx("div",{className:"px-5 sm:px-5 lg:px-10 py-5 sm:py-0 flex flex-col lg:flex-row gap-5 w-full max-w-[1440px] mx-auto",children:o.jsxs("div",{className:"flex-1",children:[o.jsxs("div",{className:"p-1 about-content",children:[o.jsx("h1",{className:"text-xl sm:text-2xl font-semibold text-purple-800",children:"About the Conference"}),o.jsx("hr",{className:"h-[2px] bg-purple-700"}),o.jsxs("div",{className:"flex flex-col lg:flex-row gap-5",children:[o.jsx("p",{className:"mt-2 basis-2/3",children:`The 7th International Conference on Recent Trends in Advanced Computing (ICRTAC'24), scheduled for November 14th and 15th, 2024, at the Vellore Institute of Technology (VIT) Chennai, India, is centered on the theme "Automating Sustainability: Bridging SDG Goals with Recent Trends in Advanced Computing." This event is dedicated to harnessing advanced computing technologies to tackle the United Nations' Sustainable Development Goals (SDGs), aiming for global progress in ending poverty and ensuring environmental protection by 2030. With a comprehensive agenda covering areas such as Blockchain, Cryptocurrency, 5G/6G Wireless, Drones, AI/ML, Quantum Computing, AR/VR, Digital Twin, Smart Cities, Fog/Edge Computing, Cyber security, automation, and Industry 4.0, the conference seeks to pioneer advanced algorithmic approaches surpassing classical techniques. It serves as an interdisciplinary platform for researchers, practitioners, and educators to deliberate on innovations in advanced computing, propose sustainable solutions to real-world challenges, explore novel automation methods, and integrate cutting-edge technologies with Robotic Process Automation to align SDG goals with recent trends in advanced computing, underscoring the imperative of automating sustainability for global development. In partnership, UPM, BIS, and UiPath converge to champion sustainable development through their expertise in agricultural sciences, standardization, quality certification, and AI-powered enterprise automation, with a shared commitment to driving impactful solutions and fostering innovation on a global scale.`}),o.jsx("img",{src:uv,className:"h-64 object-contain flex items-center justify-center mx-auto mt-3 basis-1/3",alt:"ICRTAC Logo"})]})]}),o.jsxs("div",{className:"p-1 mt-10 objectives-content",children:[o.jsx("h1",{className:"text-xl sm:text-2xl font-semibold text-purple-800",children:"Objectives"}),o.jsx("hr",{className:"h-[2px] bg-purple-700"}),o.jsxs("ul",{className:"list-disc list-inside mt-3",children:[o.jsx("li",{children:"Explore the potential applications of advanced techniques in computing to provide innovative solutions"}),o.jsx("li",{children:"Provide an interdisciplinary platform for researchers, practitioners, and educators to discuss contemporary innovations in advanced computing and suggest sustainable solutions to real world problems"}),o.jsx("li",{children:"Investigate novel methods in automation and intelligent techniques, integrating cutting-edge computing technologies with the use of Intelligent Process Automation"}),o.jsx("li",{children:"Bridge SDG goals and Indian Standards with recent trends in advanced computing, emphasizing the importance of automating sustainability for global development"})]})]}),o.jsxs("div",{className:"p-1 mt-10 tracks-content",children:[o.jsx("h1",{className:"text-xl sm:text-2xl font-semibold text-purple-800",children:"Tracks"}),o.jsx("p",{className:"text-base",children:"The seventh edition of ICRTAC'24 invites submissions of original unpublished technical papers on the following topics, but not limited to:"}),o.jsx("hr",{className:"h-[2px] bg-purple-700"}),o.jsx("p",{className:"font-bold mt-1",children:"Artificial Intelligence:"}),o.jsxs("ol",{className:"list-decimal list-inside ",children:[o.jsx("li",{childre
